import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

const App = () => (
  <div>
    <p>Hello world</p>
  </div>
)

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

